import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for a product card to appear (use .product-card)
    await page.waitForSelector('.product-card', { timeout: 10000 });

    // Use nth-of-type to pick the first product card
    const productCard = (await page.$$('.product-card'))[0];
    if (!productCard) throw new Error('No product card found');

    // Click the product card to open the product detail modal
    await productCard.click();

    // Wait for the modal to appear (use #productModal and visible)
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 10000 });
    await page.waitForSelector('.product-detail-info', { timeout: 10000 });

    // Take screenshot of product modal
    const step2 = path.join(screenshotsDir, 'step_2_modal_open.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the "Add to Wish List" button using its text (case-insensitive)
    const wishlistBtn = await page.waitForSelector("//button[contains(translate(., 'ABCDEFGHIJKLMNOPQRSTUVWXYZ', 'abcdefghijklmnopqrstuvwxyz'), 'add to wish list')]", { timeout: 10000 });
    if (!wishlistBtn) throw new Error('Add to Wish List button not found');

    // Click the "Add to Wish List" button
    await wishlistBtn.click();

    // Wait for notification to appear (class .notification with text "Added to wishlist!")
    await page.waitForSelector(".notification.success", { timeout: 10000 });
    // Wait for the notification text to match
    await page.waitForSelector("//div[contains(@class,'notification') and contains(.,'Added to wishlist')]", { timeout: 10000 });

    // Take screenshot after adding to wishlist
    const step3 = path.join(screenshotsDir, 'step_3_added_to_wishlist.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Close the modal (click the close button in modal, .close at top right)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
      // Wait for modal to disappear
      await page.waitForSelector('#productModal', { state: 'hidden', timeout: 10000 });
    }

    // Go to wishlist page: find "Your Wish List" link (use text and visible)
    const wishListLinks = await page.$$('a');
    let wishListLink = null;
    for (const link of wishListLinks) {
      const text = (await link.textContent() || '').trim().toLowerCase();
      if (text === 'your wish list') {
        wishListLink = link;
        break;
      }
    }
    if (!wishListLink) throw new Error('Your Wish List link not found');
    await wishListLink.click();

    // Wait for the wishlist page to load (look for .wishlist-page or .wishlist-items)
    await page.waitForSelector('.wishlist-page, .wishlist-items', { timeout: 10000 });

    // Take screenshot of wishlist page
    const step4 = path.join(screenshotsDir, 'step_4_wishlist_page.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract the first wishlist item title for verification
    const wishlistTitle = await page.$eval('.wishlist-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Added first product to wishlist and verified presence in wishlist page",
      extractedData: {
        wishlistFirstItemTitle: wishlistTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
